import React, { useContext } from 'react'
import { dataContext } from '../Context/DataContext'


function Products() {
    const { data } = useContext(dataContext)
    return (
            <div>
                {data.map((product)=>{
                    <div key={product.id}>
                        <img src={product.photo} />
                        <h1>{product.title}</h1>
                    </div>
                })}
                
            </div>
    )
}

export default Products
